import React from "react";
import "./Navbar.scss";
import { Link } from "react-router-dom";
import "./Navbar.scss"
// import { Navbar, Nav, Container } from "react-bootstrap";
function Navbarr (){
    return (
        <div className="Navbar">
        <h1>Sticky Notes</h1>
            <Link to="/">
            <h1>Nav bar</h1>
            </Link>
            <Link to="/login">
            <h1>Login</h1>
            </Link>
            <Link to="/register">
            <h1>Register</h1>
            </Link>
        </div>
    )
};

export default Navbarr;
